import { useEffect, useState } from "react";
import "./App.css";

const App = () => {
  useEffect(() => {
    const { cases, setCases } = useState(0);
    fetch("/global-data")
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setCases(data[0].confirmed);
      });
  }, []);
  return (
    <div>
      <h1>{cases}</h1>
    </div>
  );
};

export default App;
